import React from 'react';
import Header from '../components/header';
import Footer from '../components/footer';
import Movies from '../components/movies'

export default function Home() {
  const Child = ({ match }) => (
    <div>
      <h3>ID: {match.params.id}</h3>
    </div>
  )

  return (
    <div>
      <Header />
      <Movies />
      <Footer />
    </div >
  )
}
